import React, { Component, useState, useEffect } from "react";
import axios from "axios";

const CreateUser = () => {

  const PostUser = () => {
    const [user, setUser] = useState([]);
    const userToPost = { name: "reactuser" };
    const postUser = () => {
      axios.post("http://localhost:8080/add", userToPost).then((res) => {
        console.log(res);
        setUser(res.data);
      });
    };
    useEffect(() => {
      postUser();
    }, []);

    return <h1>{user.id}</h1>
  };
  return (
    <div>
      <h2>Add user</h2>
      <form>
        <label>Name</label>
        <input type="text" requried name="name"></input>
        <button type="submit" action=<PostUser></PostUser>>Add</button>
      </form>
    </div>
  );
};

export default CreateUser;
